import React, { Component, Button } from "react";
import NavBar from "./components/banner";
import LoginForm from "./components/loginForm";
import UserLatNavBar from "./components/userLatNavBar";
import UserRegForm from "./components/userRegForm";
import axios from "axios";

class Teste extends Component {
  render() {
    let num = 0;
    let dir = window.location.pathname;

    if (dir === "/main") num = 1;
    if (dir === "/regUser") num = 2;
    switch (num) {
      case 2: {
        console.log("Rendering User Registration Form");
        return (
          <React.Fragment>
            <NavBar />
            <main className="container">
              <UserRegForm />
            </main>
          </React.Fragment>
        );
      }
      case 1: {
        return (
          <React.Fragment>
            <NavBar />
            <main className="container">
              <UserLatNavBar />
            </main>
          </React.Fragment>
        );
      }

      case 0: {
        return (
          <React.Fragment>
            <NavBar />
            <main className="container">
              <LoginForm />
            </main>
            ;
          </React.Fragment>
        );
      }
    }
  }

  async getDataAxios() {
    console.log("Sending request");
    const response = await axios.get("https://localhost:8080");
    console.log(response.data);
  }
}

export default Teste;
